import React from 'react';
import Balloons from '../assets/Home/balloons.png';
import Sea from '../assets/Home/sea.png';

import ArtIcon from '../assets/Home/art.png';
import PHUNG from '../assets/Home/PHUNG.svg';
import NGO from '../assets/Home/NGO.svg';
import FrontEnd from '../assets/Home/Front-End.svg'; 
import UXDesigner from '../assets/Home/UX-Designer.svg'; 
import SmileIcon from '../assets/Home/happy.png';

const Home = () => {
    return (
        <div className="home-wrapper">
            <navigation className="nav-bar">
                <div className="nav-contacts">
                    <img src={Balloons} alt="" width="45" />
                    <a href="">CONTACTS</a>
                </div>

                <div className="nav-items">
                    <div className="nav-item">
                        <a href="">ABOUT</a>
                        <img src={Sea} alt="" width="28" />
                    </div>
                    <div className="nav-item">
                        <a href="">PROJECTS</a>
                        <img src={Sea} alt="" width="28" />
                    </div>
                </div>
            </navigation>

            <div className="home">
                <div>
                    <img src={ArtIcon} alt="" width="28" />
                    <img src={PHUNG} alt=""/>
                    <img src={NGO} alt=""/>
                    <img src={SmileIcon} alt="" width="28" />
                </div>
                <div>
                    <img src={FrontEnd} alt=""/>
                    <img src={UXDesigner} alt=""/>
                </div>
            </div>
        </div>
    )
}

export default Home;
